import { StyleSheet } from "react-native";
const styles = StyleSheet.create({
  image: {
    resizeMode: "cover",
    height: 500,
    width: "100%",
    justifyContent: "center",
  },
  container: {
    marginLeft: 0,
  },
  explore: {
    marginLeft: 6,
    backgroundColor: "white",
    height: 40,
    width: 200,
    borderRadius: 10,
    justifyContent: "center",
    alignItems: "center",
  },
});
export default styles;
